import React from "react";
import "./App.css";

function MyButton() {
  const buttonText = "Sign-in";

  return (
    <button onClick={handleClick}>
      {buttonText}
    </button>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>TitanEats</h1>
        <MyButton />
      </header>
    </div>
  );
} 

function App2() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>SIGN IN PAGE</h1>
        <MyButton />
      </header>
    </div>
  );
} 

export default App;
